import React from 'react';
import './Signup.css';


 const Signup = (props) => { 
    
    return (
        <div className="signup">
         <p className="text"> {props.field} :</p>
         <div className="inputbox"><input  type={props.type} onChange={props.changed} onClick={props.click}/> </div>
        </div>
       
    );

}
export default Signup;
